/* INTERACTIVE COMPONENTS */
import PostCard from '../components/postCard'

const HomePage = () => {
  return (
    <div class = "bodyContent">
        <div class = "postsFrame">
          <div class = "headingFrame"></div>
            <PostCard/>
            <PostCard/>
            <PostCard/>
        </div>
    </div>
  );
}

export default HomePage
